INSERT INTO plantillas_cartas_notificacion VALUES("1","F20170854793726EQC7203","Inasistencias","<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${comunaEmpresa}, ${fechaPalabras}</span></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Se&ntilde;or:</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${nombreTrabajador}</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">RUT: ${rutTrabajador}</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${direccionTrabajador}, ${comunaTrabajador}</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${ciudadTrabajador}</span></strong></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p>\n<p><strong><u><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Presente</span></u></strong></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">De nuestra consideraci&oacute;n:</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp; &nbsp; Mediante la presente, comunico a Usted que se ha resuelto amonestarlo formalmente, debido a que usted ha faltado sin causa justificada los siguientes d&iacute;as:</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${faltas}</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp; &nbsp; Le recordamos que de acuerdo a lo estipulado en su contrato de trabajo en la cl&aacute;usula TERCERA&nbsp;dice lo siguiente:</span></p>\n<p style=\"text-align: center;\" align=\"center\"><span style=\"font-family: Verdana, sans-serif;\">&ldquo;La jornada de trabajo ser&aacute; la siguiente de Lunes a Viernes, el horario ser&aacute; de&nbsp;</span>08:30 a 13:00 Hrs. Y de 14:00 a 18:30 Hrs.&rdquo;</p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp; &nbsp; Por lo anterior, le instamos a que supere esta situaci&oacute;n y que en lo sucesivo cumpla las disposiciones establecidas por la empresa a este respecto.</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp; &nbsp; Sin otro particular, saluda Atte a Ud.</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p>\n<p style=\"text-align: right;\" align=\"right\"><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${nombreEmpresa}</span></strong></p>\n<p style=\"text-align: right;\" align=\"right\"><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">R.U.T. ${rutEmpresa}</span></strong></p>","2017-04-24 00:00:00","2017-05-03 13:35:19",NULL);
INSERT INTO plantillas_cartas_notificacion VALUES("2","P20170502015820WHI4173","Término de Contrato","<p style=\"text-align: right;\"><span style=\"font-family: Verdana, sans-serif;\">${comunaEmpresa}, ${fechaPalabras}</span></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Se&ntilde;or:</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${nombreTrabajador}</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">RUT: ${rutTrabajador}</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${direccionTrabajador}, ${comunaTrabajador}</span></strong></p>\n<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">${ciudadTrabajador}</span></strong></p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\"><strong>Presente</strong></span></p>\n<p>&nbsp;</p>\n<p style=\"text-align: left;\">&nbsp; &nbsp; Comunico a Ud. que con fecha ${fechaPalabras}, se ha resuelto poner t&eacute;rmino al Contrato de Trabajo que la vinculaba con&nbsp;<strong>${nombreEmpresa}</strong>&nbsp;desde el ${fechaInicialPalabras}&nbsp;en su calidad de ${cargoTrabajador}, de acuerdo a lo establecido en el Art&iacute;culo 160 N&deg; 3 del C&oacute;digo del Trabajo, esto es, &ldquo;No concurrencia del trabajador a sus labores sin causa justificada durante dos d&iacute;as seguidos, dos lunes en el mes o un total de tres d&iacute;as durante igual periodo de tiempo&rdquo;.</p>\n<p style=\"text-align: left;\">&nbsp; &nbsp; Los hechos en que se funda la causal invocada se sustentan, en que usted ha faltado sin causa justificada dos d&iacute;as seguidos y un total de tres en igual per&iacute;odo de tiempo, esto es, ${faltasLineal}, hasta la fecha usted no se ha comunicado con la empresa. Seg&uacute;n consta en su contrato de trabajo, por turno le correspond&iacute;a presentarse los d&iacute;as:</p>\n<p>&nbsp;</p>\n<p><span style=\"font-family: Verdana, sans-serif;\">${faltas}</span></p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; Informo a Ud. que sus cotizaciones previsionales, de salud y seguro de cesant&iacute;a han sido integras y oportunamente enteradas en los organismos pertinentes.</p>\n<p>&nbsp; &nbsp; Asimismo se hace entrega del certificado correspondiente de acuerdo a la Ley N&deg; 19.631.</p>\n<p>&nbsp; &nbsp; Se deja constancia que su finiquito estar&aacute; a su disposici&oacute;n en nuestras oficinas ubicada en ${domicilioEmpresa}&nbsp;Santiago el d&iacute;a FECHA. Saluda atentamente a Ud.,</p>\n<p style=\"text-align: center;\"><strong>${nombreEmpresa}</strong></p>\n<p style=\"text-align: center;\"><strong>RUT:&nbsp;</strong><strong>${rutEmpresa}</strong></p>","2017-05-02 01:58:21","2017-05-02 20:16:33",NULL);
INSERT INTO plantillas_certificados VALUES("1","H20170503141834UJK3074","Certificado de Antigüedad Laboral","<p style=\"text-align: center;\">EMPRESA</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">${nombreEmpresa}</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\"><strong>CERTIFICADO DE ANTIG&Uuml;EDAD</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p>El suscrito, certifica que el Sr. (a) ${nombreTrabajador}, RUT: ${rutTrabajador}, es funcionario de la Empresa ${nombreEmpresa} desde el ${fechaInicialPalabras}, ocupando el cargo de ${cargoTrabajador}.</p>\n<p>&nbsp;</p>\n<p>Su contrato de trabajo es de car&aacute;cter ${contratoTrabajador}.</p>\n<p>&nbsp;</p>\n<p>Se otorga el presente certificado a pedido del interesado para los fines que estime conveniente.</p>\n<p>&nbsp;</p>\n<p>${ciudadEmpresa}, ${fechaPalabras}.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\">${nombreRepresentanteEmpresa}</p>\n<p style=\"text-align: center;\">Gerente General</p>\n<p style=\"text-align: center;\">${nombreEmpresa}</p>\n<p style=\"text-align: center;\">&nbsp;</p>","2017-05-03 14:18:35","2017-05-03 15:58:49",NULL);
INSERT INTO plantillas_certificados VALUES("2","O20170503142149UHJ6212","Certificado de Remuneraciones","<p style=\"text-align: center;\">EMPRESA</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\">${nombreEmpresa}</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\"><strong>CERTIFICADO DE ACREDITACI&Oacute;N DE RENTA MENSUAL</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p>El suscrito, certifica que el Sr. (a) ${nombreTrabajador}, RUT: ${rutTrabajador}, es funcionario de la Empresa ${nombreEmpresa}, dispone de una renta l&iacute;quida mensual de ${sueldoBase} (${sueldoBasePalabras}) esto sin descontar pr&eacute;stamos.</p>\n<p>&nbsp;&nbsp;</p>\n<p>Se otorga el presente certificado a pedido del interesado para los fines que estime conveniente.</p>\n<p>&nbsp;</p>\n<p>${ciudadEmpresa}, ${fechaPalabras}.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\">${nombreRepresentanteEmpresa}</p>\n<p style=\"text-align: center;\">Gerente General</p>\n<p style=\"text-align: center;\">${nombreEmpresa}</p>\n<p style=\"text-align: center;\">&nbsp;</p>","2017-05-03 14:21:50","2017-05-03 16:04:43",NULL);
INSERT INTO plantillas_contratos VALUES("1","G20172547893540EQC7203","Contrato Normal","<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\"><strong>Contrato Individual de&nbsp;Trabajo</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p>En ${comunaEmpresa}, a ${fechaPalabras}, entre la empresa <strong>${nombreEmpresa}</strong> RUT: <strong>${rutEmpresa}</strong>, representada por don <strong>${nombreRepresentanteEmpresa}</strong> en su calidad de Representante legal c&eacute;dula de identidad N&deg; <strong>${rutRepresentanteEmpresa}</strong>, con domicilio en ${domicilioRepresentanteEmpresa}, en adelante, \"el empleador\"; y don <strong>${nombreTrabajador}</strong> de nacionalidad ${nacionalidadTrabajador}, c&eacute;dula de identidad N&deg; <strong>${rutTrabajador}</strong>, de estado civil ${estadoCivilTrabajador}, fecha de nacimiento ${fechaNacimientoPalabrasTrabajador}, con el cargo de ${cargoTrabajador}, domiciliado en ${domicilioTrabajador}, y, en consecuencia, capaz de celebrar contrato de trabajo en adelante \"el trabajador\"; las partes han convenido celebrar el presente contrato de trabajo al tenor de las siguientes:</p>\n<p><strong>CL&Aacute;USULAS:</strong></p>\n<p>${clausulas}</p>\n<p><span style=\"text-decoration: underline;\"><strong>Se deja constancia que el trabajador:</strong></span></p>\n<p>Est&aacute; afiliado a Instituci&oacute;n Previsional AFP o R&eacute;gimen Antiguo: <strong>AFP ${trabajadorAfp}</strong></p>\n<p>Est&aacute; afiliado a Instituci&oacute;n de Salud ISAPREo FONASA: <strong>${trabajadorIsapre}</strong></p>","2017-04-26 00:00:00","2017-04-28 16:03:59",NULL);
INSERT INTO plantillas_contratos VALUES("2","X20170502163651OVU2843","Contrato a extranjeros","<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>CONTRATO DE TRABAJO EXTRANJERO VISA TEMPORARIA POR MOTIVOS LABORALES</strong></span></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p>En ${comunaEmpresa}, al <strong>${fechaPalabras}</strong>, entre&nbsp;<strong>${nombreEmpresa}</strong>&nbsp;RUT:&nbsp;<strong>${rutEmpresa}</strong>, representado(a) por&nbsp;<strong>${nombreRepresentanteEmpresa}</strong>, c&eacute;dula de identidad <strong>${rutRepresentanteEmpresa}</strong>&nbsp;domiciliado en <strong>${domicilioRepresentanteEmpresa}</strong>, que en adelante se denominar&aacute; \"el(la) empleador(a)\"; y don&nbsp;<strong>${nombreTrabajador}</strong>, de nacionalidad <strong>${nacionalidadTrabajador}</strong>, nacido el <strong>${fechaNacimientoPalabrasTrabajador}</strong>, c&eacute;dula nacional de identidad&nbsp;<strong>${rutTrabajador}</strong>, de profesi&oacute;n u oficio <strong>${cargoTrabajador}</strong>, de estado civil <strong>${estadoCivilTrabajador}</strong>, domiciliado(a) en <strong>${domicilioTrabajador}</strong>, que en adelante se denominar&aacute; \"el trabajador\", se ha convenido en el siguiente contrato de trabajo:</p>\n<p>&nbsp;</p>\n<p><strong>CL&Aacute;USULAS:</strong></p>\n<p>${clausulas}</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>","2017-05-02 16:36:52","2017-05-02 16:36:52",NULL);
INSERT INTO plantillas_finiquitos VALUES("1","J20170613165602UTX9296","Finiquito Normal","<p style=\"text-align: center;\"> </p>\n<p style=\"text-align: center;\"><strong>Finiquito</strong></p>\n<p style=\"text-align: center;\"> </p>\n<p>En ${comunaEmpresa}, a ${fechaPalabras}, entre <strong>${nombreEmpresa}</strong> RUT: <strong>${rutEmpresa}</strong>, con domicilio en ${domicilioEmpresa}, en adelante, \"el empleador\"; y don(ña) <strong>${nombreTrabajador}</strong>, RUT: <strong>${rutTrabajador}</strong>, con domicilio en ${domicilioTrabajador}, de nacionalidad ${nacionalidadTrabajador}, nacido(a) el ${fechaNacimientoPalabrasTrabajador}, en adelante \"el trabajador\", por otra parte, se conviene el siguiente finiquito:</p>\n<p> </p>\n<p><strong>CLÁUSULAS:</strong></p>\n<p>${clausulas}</p>\n<p> </p>","2017-06-13 16:56:03","2017-06-13 17:44:36",NULL);
